syntax = "proto3";

package intrinsic_proto.performance.skills;

import "google/protobuf/struct.proto";
import "google/protobuf/timestamp.proto";

message Event {
  string name = 1;
  google.protobuf.Timestamp timestamp = 4;
  optional google.protobuf.Struct data = 5;
}
